			["125683"] = {
				["quotes"] = {
					["CHAT_MSG_MONSTER_YELL"] = {
						["The Legion drains the blood of a colossal creature that slumbers beneath the surface. They must be stopped!"] = true,
						["Now is your chance. Finish this fight!"] = true,
					},
					["CHAT_MSG_MONSTER_SAY"] = {
						["Ah yes, the unmistakable stench of Legion filth. Seek out the source and destroy it!"] = true,
						["Know that every path I took led toward a single purpose: saving our world. I could abide no half measures. No compromise."] = true,
						["The Legion believes itself entrenched on Argus. Untouchable. Reward their arrogance with suffering!"] = true,
						["You never trusted my intentions... though I suppose I did not make it easy for you."] = true,
						["At those times when I faced doubt, I held true to one constant. One anchor. You."] = true,
						["You have spent a lifetime fighting for the dream of what Azeroth could be. Now you must fight for what it is."] = true,
						["Take care of Tyrande. Listen to her counsel. She was always the best of us."] = true,
						["But now, as my fate becomes clear, I wish to quiet the strife that has long divided us."] = true,
						["You have always embodied the best of Azeroth, Tyrande. Your faith. Your devotion. Through the darkest times, my belief in you never wavered."] = true,
						["Brutal eredar have been awakened from their stasis. Cut them down where they stand!"] = true,
						["Even when the Legion is gone, new threats will arise. There is no one I trust to face them more than you, brother."] = true,
						["Even now, enemies gather... and the shadows grow darker. From this day forward, the defense of our world... of all we hold dear... rests with you."] = true,
						["But over time, that faith was lost. And like my brother, you came to believe that the choices I made had driven me to darkness."] = true,
						["That fiend earned its death a thousand times over. Now it shall suffer the wrath of its vile master."] = true,
						["Tyrande... Long ago, you trusted me enough to defy Malfurion's wishes and free me from my prison."] = true,
						["The Legion's morale crumbles... as does their hold on Argus."] = true,
						["The moment that the way to Argus opened... the instant my gaze fell upon the Legion's home world... I knew I would not be returning from it."] = true,
						["Malfurion... Even in the womb, we grappled with one another. Struggle has followed us all our lives."] = true,
						["Take care of him, Tyrande. Though at times I wished your heart had made a different choice, in the end... I know it made the right one."] = true,
						["But enough dwelling on the past. The crystal I left for you to find holds not two messages, but three. The last is for you, champion."] = true,
						["The Well of Eternity. I am not one for sentiment... but if anything embodies my commitment to Azeroth, it is the font of power I created so long ago."] = true,
						["The road ahead will be long. Whatever comes, bring honor to the name... Stormrage."] = true,
						["It was power I sought... but not to conquer or rule. It was a means to an end... to save Azeroth from an unstoppable foe."] = true,
						["You brought down the brutes and cost the Legion another victory. Their downfall is at hand."] = true,
						["My fate, my duty, are now clear to me. I leave Azeroth's defense to you... and to my brother."] = true,
						["You have proven your commitment to Azeroth. Your dedication, your sacrifice, rivals my own. But more will be asked of you. So much more."] = true,
						["I will face my destiny, whatever it may hold. Yet... I have left certain matters unsettled... old wounds that I would see mended."] = true,
						["The teachings of Cenarius were always your path. I felt... another calling."] = true,
					},
				},
