			["110599"] = {
				["quotes"] = {
					["CHAT_MSG_MONSTER_SAY"] = {
						["I will gladly serve if you will have me. I have access to all of Razelikh's knowledge. Allow me to aid you in the war against the Legion."] = true,
						["Where to begin? I suppose the only thing that matters was the battle between me and the demon."] = true,
						["The next thing I knew, we were expelled from the Twisting Nether, summoned by the Burning Legion to the invasion of Azeroth. At the Felblaze Ingress, I did my best to disrupt their efforts."] = true,
						["Razelikh the Defiler was a dreadlord who had been charged with the conquest of the Blasted Lands. I traveled there to stop him. But, that did not turn out the way that I had planned."] = true,
						["Some time later, the blade was destroyed. Our souls escaped only to be sent to the Twisting Nether. However, Razelikh has a very powerful demon soul. As happens with many dreadlords, a new body eventually formed. It is said that they can only truly be killed within the Twisting Nether."] = true,
						["In the end, the Defiler possessed me, and in turn, I sacrificed myself so that we both would die. Our souls were trapped within an enchanted blade to battle for all eternity."] = true,
						["The rest, you know. Your champion came and retrieved me, and here I am."] = true,
						["Within this new body, our souls are still entwined in eternal conflict. I am in control... most of the time, though it is a constant struggle. We demon hunters are accustomed to containing the demon within."] = true,
					},
				},
