						["And now you will bear witness to Huln's trials..."] = true,
						["At the call of Krasus, he defied the Legion and defeated many demons with the Eagle Spear."] = true,
						["Battling his grief, Huln spoke with the leaders of the remaining tribes. He convinced them to unite under one banner to oppose this new threat."] = true,
