			["154480"] = {
				["quotes"] = {
					["CHAT_MSG_MONSTER_YELL"] = {
						["Oh, I intend to. I merely wanted our guests to bear witness to your glorious ascension."] = true,
						["Now is that any way to repay me for my generosity? For the privilege I have seen fit to grant you?"] = true,
						["Gaze upon true devotion, landwalkers! Behold the rage of a queen!"] = true,
						["There is no power I cannot defile!"] = true,
						["You asked to be powerful, Priscilla. Consider our bargain complete."] = true,
						["I call the cursed lovers to enter the stage!"] = true,
						["My subjects seldom face a true challenge. You will try to provide them with one, won't you?"] = true,
						["I am weary of this farce. Obey my edicts or suffer the consequences."] = true,
						["You must indulge the theatrical nature of tonight's entertainment. We have waited so very long for this moment, and we simply cannot resist savoring it."] = true,
						["Perhaps he was right after all. You do show great potential."] = true,
						["Ah, good. You arrived just in time to welcome these little ones into my service."] = true,
						["You've grown complacent. Allow me to liven the field."] = true,
						["Their eyes long for one another, yet their gaze incurs calamity."] = true,
						["Without further ado... The stage is set, the hour is at hand. Legions arise! Serve your queen's command!"] = true,
						["At last! The final preparations are in place, and we have a captive audience."] = true,
