				["end"] = {
					["NPC:96270"] = true,
				},
				["reward_text"] = "That day, the hammer freed me of the corruption of the Black Dragonflight.\n\nIn gratitude, I have faithfully served the Highmountain family since Huln rescued me from this pit.\n\nIt has been my honor and my pleasure to watch each of his descendants earn the title of High Chieftain.",
