			[46866] = {
			},
			[58151] = {
				["reward_text"] = "Your work will not go unnoticed. Of that, I am certain.",
				["progress_text"] = "The winds envelop us, comforting, calming... but beneath it all lurks a great, ever-present darkness.",
				["end"] = {
					["NPC:160252"] = true,
				},
			},
			[48976] = {
